import React from 'react';
import style from './';

function ContactUs() {
  return (
    <div className={styles.container}>
      <div className={styles.card}>

      
      <h1>Contact Us</h1>
      <p>
If you have any questions about this policy or your privacy while using Cookie Crumbs, feel free to reach out:</p>
<p>Email: support@cookiecrumbs.app</p>
    </div>
    </div>
  );
}

export default ContactUs;
